import React from "react";
import ReactDOM from "react-dom";
import "../componentCss/PortContentCss.css";
import "../grid.css";

class PortContent extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { describe, describeHeader, source } = this.props;
    return (
      <div className="c-4 wrapper">
        <div className="img">
          <img src="../img/Duc.jpg" alt="not available" />
        </div>
        <h3 className="desHeader">{describeHeader}</h3>
        <p className="des"> {describe}</p>
      </div>
    );
  }
}

export default PortContent;
